import { Home, FullPost, Registration, AddPost, Login } from "./pages";

function App() {
  return (
    <>
      <Header />
      <Container maxWidth="lg">
          <Routes>
              <Route path = "/" element={<Home/>} />
              {/*<Home />*/}
              {/*<FullPost />*/}
              {/*<AddPost />*/}
              {/*<Login />*/}
              {/*<Registration />*/}
          </Routes>
      </Container>
    </>
  );
}

export default App;
